INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1120052, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/1, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"「ムカデ」を漢字で書くときに使用する漢数字は「十」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1120054, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/1, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"一つのことが巡り巡って意外なところに影響を及ぼすことを「風が吹けば医者が儲かる」という", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1120055, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/1, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"四字熟語「いちねんほっき」を漢字にすると「一年発起」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1120057, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/1, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"「お酒を飲めない人」を意味する言葉は「上戸」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1120058, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/1, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"「うっかり間違い」は、和製英語で「ケアレスミス」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1120060, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/1, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"目をかけていた者に裏切られることは、「飼い犬に腕をかまれる」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1120061, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/1, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"「拝啓」に続く結語は「敬具」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
