INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1210055, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/1, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"十二支のうち、唯一の想像上の生き物は「たつ」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1210057, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/1, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"太陽の日を浴びて日焼けする原因は「赤外線」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1210058, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/1, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"ハ虫類の成長過程で、古い皮を脱ぎ捨てることを「変態」という", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1210060, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/1, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"犬の感覚で、人よりも100万倍以上すぐれているとされるものは「嗅覚」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1211001, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/1, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/1, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"コッコロの主人公に対する呼び方は「主どの」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
