INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230036, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"身、皮、肝、エラなどが「七つ道具」と呼ばれ、すべて鍋に入れられる魚は「アンコウ」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230037, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"シシャモは市場に出回っているもののほとんどが「カペリン」という別の魚である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230038, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"しゃっくりは、「腹直筋」のけいれんによって起こる", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230039, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"子どものときにはエラ呼吸、大人になると肺呼吸する生物を「は虫類」という", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230040, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"ブリやスズキに代表される、成長過程で呼び名が変わる魚を「出世魚」という", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230041, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"トリカブトは「テトロドトキシン」という猛毒を持つ", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230043, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"光るものを口に入れる習性がある牛。その胃を守るため、牧場などでは「磁石」を飲ませている", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230044, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"ジャイアントパンダが主に食べるのは「ユーカリ」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230046, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"日本に生息するヤマネコは2種類。「ツシマヤマネコ」と「イリオモテヤマネコ」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230047, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"漢字では「桃花心木」、高級木材として知られる、センダン科の植物は「マホガニー」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230050, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"ワラビ、ゼンマイは「コケ類」に分類される", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230051, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"タイ料理のトムヤンクンにも用いるハーブ、レモングラスは「バラ科」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230052, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"十二指腸に続く、人間の胃にある出口の部分を「鬼門」という", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230053, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"英語で「ヒポポタマス」といえば、「カバ」のことである", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230054, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"和紙の原料になるジンチョウゲ科の植物は、枝が分かれていることから「フタマタ」という名がついた", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230055, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"サボテンやアロエのような、茎や葉の厚い植物を「多肉植物」という", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230056, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"漢字では「山茶花」。秋の終わりから冬にかけて咲くツバキ科の花は「さんざし」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230057, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"リャマとアルパカは、どちらも「ラクダ科」の動物である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1230058, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/2, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/3, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"人の体内で、食べたものが最後に通過する臓器は「盲腸」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
