INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1420042, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/4, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"魚の頭の部分だけを焼いた料理を「ぼうし焼き」という", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1420043, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/4, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"ハマグリなどを煮出して、薄い塩だけで味付けしたお吸い物を「あら汁」という", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1420044, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/4, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"巻き寿司の一種、かっぱ巻きにふつう用いられる具材は「きゅうり」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1420046, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/4, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"和食で調味料を用いる順番をさす「さしすせそ」。「し」は「醬油」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1420048, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/4, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"焼肉を巻いて食べる葉レタスのことを韓国語で「サンチュ」という", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
INSERT INTO `v1_38af0e56a2ca6ec9a37efaf06db06ab45391dbe30d982c6eb1a2dec6575daa1f` VALUES (/*ac8e40fce27ce25c17eb370538c0f9c02c415a739fcc6da6579ebb1988461b23*/1420049, /*4d2730255fcc452d6e1b6aee99cb06a07728898c870f502b3fe3bb1673eca282*/4, /*0a882aa522f29bf154ec18d10e2d35bb0269ca21c719998f47a7a0aa6f3fe1cc*/2, /*970d7dfde121b558614f66687e48033ba2869c7a88afe689b4a71d2dd3a46acd*/2, /*096f00e076d15af57af071a800fb908f0583eb78ef2b46da0a9e09c58b549645*/0, /*1d874dfa12db942691fd2a40646df9a04a22ca20c1be74a30decf3a77a12bbaa*/"パンケーキ、フレンチトースト、クリームシチューに共通して使われる飲み物は「牛乳」である", /*3e8d8af403e853c7ab48aa46542c26c7f8a809b907cc86dd31da6b70dd263823*/1);
